import React, { useState } from "react";

interface Sale {
  customer: string;
  product: string;
  quantity: number;
  amount: number;
  date: string;
}

const SalesManagement: React.FC = () => {
  const [sales, setSales] = useState<Sale[]>([]);
  const [customer, setCustomer] = useState("");
  const [product, setProduct] = useState("");
  const [quantity, setQuantity] = useState<number>(1);
  const [amount, setAmount] = useState<number>(0);
  const [date, setDate] = useState<string>("");
  const [editIndex, setEditIndex] = useState<number | null>(null);

  const handleAddOrEditSale = (e: React.FormEvent) => {
    e.preventDefault();
    if (!customer.trim() || !product.trim() || quantity <= 0 || amount <= 0 || !date) return;

    if (editIndex !== null) {
      // Edit existing sale
      const updated = [...sales];
      updated[editIndex] = { customer: customer.trim(), product: product.trim(), quantity, amount, date };
      setSales(updated);
      setEditIndex(null);
    } else {
      // Add new sale
      setSales([...sales, { customer: customer.trim(), product: product.trim(), quantity, amount, date }]);
    }
    setCustomer("");
    setProduct("");
    setQuantity(1);
    setAmount(0);
    setDate("");
  };

  const handleEdit = (idx: number) => {
    const sale = sales[idx];
    setCustomer(sale.customer);
    setProduct(sale.product);
    setQuantity(sale.quantity);
    setAmount(sale.amount);
    setDate(sale.date);
    setEditIndex(idx);
  };

  const handleDelete = (idx: number) => {
    setSales(sales.filter((_, i) => i !== idx));
    if (editIndex === idx) {
      setEditIndex(null);
      setCustomer("");
      setProduct("");
      setQuantity(1);
      setAmount(0);
      setDate("");
    }
  };

  return (
    <div style={{ margin: "20px 0" }}>
      <h3>Sales Management</h3>
      <form onSubmit={handleAddOrEditSale}>
        <input
          type="text"
          placeholder="Customer Name"
          value={customer}
          onChange={e => setCustomer(e.target.value)}
          required
        />
        <input
          type="text"
          placeholder="Product"
          value={product}
          onChange={e => setProduct(e.target.value)}
          required
          style={{ marginLeft: "10px" }}
        />
        <input
          type="number"
          placeholder="Quantity"
          value={quantity}
          onChange={e => setQuantity(Number(e.target.value))}
          min={1}
          required
          style={{ marginLeft: "10px" }}
        />
        <input
          type="number"
          placeholder="Amount"
          value={amount}
          onChange={e => setAmount(Number(e.target.value))}
          min={0}
          required
          style={{ marginLeft: "10px" }}
        />
        <input
          type="date"
          value={date}
          onChange={e => setDate(e.target.value)}
          required
          style={{ marginLeft: "10px" }}
        />
        <button type="submit" style={{ marginLeft: "10px" }}>
          {editIndex !== null ? "Update Sale" : "Add Sale"}
        </button>
        {editIndex !== null && (
          <button
            type="button"
            onClick={() => {
              setEditIndex(null);
              setCustomer("");
              setProduct("");
              setQuantity(1);
              setAmount(0);
              setDate("");
            }}
            style={{ marginLeft: "10px" }}
          >
            Cancel
          </button>
        )}
      </form>
      <ul>
        {sales.map((sale, idx) => (
          <li key={idx}>
            {sale.date}: {sale.customer} bought {sale.quantity} of {sale.product} for R{sale.amount}
            <button onClick={() => handleEdit(idx)} style={{ marginLeft: "10px" }}>
              Edit
            </button>
            <button onClick={() => handleDelete(idx)} style={{ marginLeft: "5px" }}>
              Delete
            </button>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default SalesManagement;
